import "./App.css";
 import Sidebar from "./components/Sidebar/Sidebar";
import Home from "./components/ContentSide/Home/Home";
import { Route, Routes } from "react-router-dom";
function App() {
  return (
   <>

           <Sidebar />


    <Routes>
      <Route path="/" element={<Home />} />
    </Routes>
    </>

  );
}

export default App;
